function [EAS_f,sigma_f,EAS_Array,EAS_Array_lin,sigma,fout,fi] = BaylessAbrahamson2018_EAS_function(mag,Rrup,Vs,Ztor,FNorm,Z1,f)
%% Matlab function for the 2018 EAS model, described in Chapter 2 of Jeff Bayless's PhD Dissertation 
% This model is applicable to crustal eqks in CA and Nevada, created using PEER NGA-W2 data

% Jeff Bayless (jrbayless@ucdavis.edu) and Norm Abrahamson, December 2018
% Additional References: 
% Bayless J, and Abrahamson N.A. (2019). Summary of the BA18 Ground Motion Model for Fourier Amplitude Spectra for Crustal Earthquakes in California. Bull. Seismol. Soc. Am Vol. 109, No. 5. doi: 10.1785/0120190077
% Bayless J, and Abrahamson N.A. (2018). An empirical model for Fourier amplitude spectra using the NGA-West2 database. PEER Report No. 2018/07, Pacific Earthquake Engineering Research Center, University of California, Berkeley, CA.  

%% Description of parameters

%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%

% INPUT params, with range of model applicability in brackets. 
% Note that this script does not explicitly check that the parameters are within the usable range.

% mag:          Scalar, Moment magnitude [3, 8]
% Rrup:         Scalar, Rupture distance in km [0, 300]
% Vs:           Scalar, Vs30 in m/s [180, 1500]. Model scaling is capped to 1000 m/s.
% Ztor:         Scalar, Depth to top of rupture plane in km [0, 20]. Model scaling is capped to 20 km.
% FNorm:        Scalar, Normal style of faulting flag; 1=Normal, 0=all others
% Z1:           Scalar, Depth to Vs=1 km/s horizon in km [0,2]. Model scaling is capped to 2 km. Use Z1=-1 if unknown; sets to reference value.
% f:            Scalar, frequency in Hz [0.1, 100]

%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%

% OUTPUT params

% EAS_f:        Scalar, the Effective Amplitude Spectrum (see paper for definition) at frequency f, units g-sec, performs interpolation in log-log space if needed
% sigma_f:      Scalar, the total aleatory variability at frequency f, ln units, performs interpolation in log-lin space if needed
% EAS_array:    1x301 Array of the EAS including nonlinear site amp, at frequencies fout
% EAS_array_lin:1x301 Array of the EAS without nonlinear site amplification, at frequencies fout
% sigma:        1x301 Array of total aleatory standard deviation, sigma, at frequencies fout
% fout:         1x301 Array of the 301 model defined frequencies ranging from 0.1-100 Hz, log-spaced
% fi:           1x301 Logical array with element set to logical 1 (true) where frequency f is equal to fout. e.g., EAS_f=EAS_array(fi)

%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%

